import Axios from "axios";
import { CAR_MODEL_LIST_REQUEST, CAR_MODEL_LIST_SUCCESS, CAR_MODEL_LIST_FAIL, CAR_YEAR_REQUEST } from "../constants/carConstants"

export const modelCars = () => async (dispatch) => {
    dispatch({
        type: CAR_MODEL_LIST_REQUEST
    });
    try {
        const { data } = await Axios({
            method: 'GET',
            url: 'http://159.65.45.58:5000/get_car_data_with_model',
            headers: {
                'cache-Control': 'no-cache',
                'content-Type': 'application/json',
                'Access-Control-Allow-Origin': '*',
            },
        })
        dispatch({type: CAR_MODEL_LIST_SUCCESS, payload: data})
    } catch(error) {
        dispatch({type: CAR_MODEL_LIST_FAIL, payload: error.message});
    }
}

export const yearCars = () => async (dispatch) => {
    dispatch({
        type: CAR_YEAR_REQUEST
    });
    try {
        const { data } = await Axios({
            method: 'GET',
            url: 'https://jsonplaceholder.typicode.com/todos',
            headers: {
                'cache-Control': 'no-cache',
                'content-Type': 'application/json',
                'Access-Control-Allow-Origin': '*',
            },
        })
        dispatch({type: CAR_MODEL_LIST_SUCCESS, payload: data})
    } catch(error) {
        dispatch({type: CAR_MODEL_LIST_FAIL, payload: error.message});
    }
}
